package org.Anagram;

import java.util.Arrays;
import java.util.HashMap;
import java.util.stream.Collectors;

public class ValidAnagram {
  public static void main(String[] args) {
    ValidAnagram va = new ValidAnagram();
    EdgeCase edgeCaseOne = new EdgeCase("racecar", "carrace");
    EdgeCase edgeCaseTwo = new EdgeCase("hello", "hellu");
    EdgeCase edgeCaseThree = new EdgeCase("xx", "bb");
    EdgeCase edgeCaseFour =
        new EdgeCase(
            "",
            "");

    System.out.println(
        "The first one should pass and return :" + va.isAnagram(edgeCaseOne.s(), edgeCaseOne.t()));
    System.out.println(
        "The second one should fail and return :" + va.isAnagram(edgeCaseTwo.s(), edgeCaseTwo.t()));
    System.out.println(
        "The third one should fail and return :"
            + va.isAnagram(edgeCaseThree.s(), edgeCaseThree.t()));
    System.out.println(
        "The fourth one should pass and return :"
            + va.isAnagram(edgeCaseFour.s(), edgeCaseFour.t()));
  }

  /**
   * Time complexity S ( s + t ) iterate in both strings Space complexity S ( s + t ) building
   * hashmaps for both strings up to the size of s and t
   */
  public boolean isAnagram(String s, String t) {
    if (s.length() != t.length()) return false;
    HashMap<Character, Integer> table_s = new HashMap<>();
    HashMap<Character, Integer> table_t = new HashMap<>();
    for (int i = 0; i < s.length(); i++) {
      table_s.put(s.charAt(i), table_s.getOrDefault(s.charAt(i), 0) + 1);
      table_t.put(t.charAt(i), table_t.getOrDefault(t.charAt(i), 0) + 1);
    }
    return table_s.equals(table_t);
  }

  /**
   * It is more efficient in Space complexity as you're creating only 1 hashmap however it fails
   * third edge case scenario
   */
  public boolean isAnagramEfficientHashMap(String s, String t) {
    if (s.length() != t.length()) return false;
    HashMap<Character, Integer> countS = new HashMap<>();
    for (int i = 0; i < s.length(); i++) {
      countS.put(s.charAt(i), countS.getOrDefault(s.charAt(i), 0) + 1);
      countS.put(t.charAt(i), countS.getOrDefault(t.charAt(i), 0) + 1);
    }
    for (int value : countS.values()) {
      if (value % 2 != 0) {
        return false;
      }
    }
    return true;
  }

  public boolean isAnagramCopilot(String s, String t) {
    if (s.length() != t.length()) return false;
    return s.chars()
        .sorted()
        .mapToObj(c -> String.valueOf((char) c))
        .collect(Collectors.joining())
        .equals(
            t.chars()
                .sorted()
                .mapToObj(c -> String.valueOf((char) c))
                .collect(Collectors.joining()));
  }

  public boolean isAnagramSlicingSecondString(String s, String t) {
    if (s.length() != t.length()) return false;

    for (int i = 0; i < s.length(); i++) {
      char c = s.charAt(i);
      int index = t.indexOf(c);
      if (index == -1) {
        return false; // character not found in t
      }
      t = t.substring(0, index) + t.substring(index + 1); // remove the character from t
    }
    return true;
  }

  /**
   * Depending on the sorting algorithm the time complexity can vary, assuming we're using the most
   * efficient one Time complexity O ( n log n ) If you sort it you compare the two strings, if they
   * are equal then they are anagrams
   */
  public boolean isAnagramBruteForceSortString(String s, String t) {
    if (s.length() != t.length()) return false;
    String[] listA = s.split("");
    String[] listB = t.split("");

    Arrays.sort(listA);
    Arrays.sort(listB);

    return Arrays.compare(listA, listB) == 0;
  }

  /**
   * Time complexity O ( n log n + m log m), because for n elements we sort the first string and for
   * m elements we sort the second string Space complexity O ( n + m ) because we create two arrays
   * for the two strings We sort them so it is extra time complexity/ computation process Then
   * finally we compare the lists, if they are equal
   */
  public boolean isAnagramBruteForceSortCharacter(String s, String t) {
    if (s.length() != t.length()) return false;
    char[] listA = s.toCharArray();
    char[] listB = t.toCharArray();

    Arrays.sort(listA);
    Arrays.sort(listB);

    return Arrays.compare(listA, listB) == 0;
  }

  public boolean isAnagramHashMap(String s, String t) {
    if (s.length() != t.length()) return false;
    HashMap<String, Integer> map = new HashMap<>();
    for (String c : s.split("")) {
      map.put(c, map.getOrDefault(c, 0) + 1);
    }

    for (String c : t.split("")) {
      map.put(c, map.getOrDefault(c, 0) + 1);
    }

    for (String key : map.keySet()) {
      if (map.get(key) % 2 != 0) {
        return false;
      }
    }
    return true;
  }

  /**
   * Time complexity O ( n + m ) where n is the length of s and m is the length of t Space
   * complexity O ( 1 ) because we are using a fixed size array of 26 elements Where n is the length
   * of the first string and m is the length of the second string
   */
  public boolean isAnagramHashTableUsingArray(String s, String t) {
    if (s.length() != t.length()) {
      return false;
    }

    int[] count = new int[26];
    for (int i = 0; i < s.length(); i++) {
      count[s.charAt(i) - 'a']++;
      count[t.charAt(i) - 'a']--;
    }

    for (int val : count) {
      if (val != 0) {
        return false;
      }
    }
    return true;
  }
}
